script: |
  super -f text -I q12089.spq | sort > q12089.out

inputs:
  - name: q12089.spq
    data: |
      SELECT + + col1 AS col0 FROM tab2 (FORMAT parquet) WHERE - + 51 * + col0 * + col0 * - col1 + col1 IS NOT NULL;
  - name: tab2

outputs:
  - name: q12089.out
    data: |
      51
      67
      77
